import React from 'react'
import styled from 'styled-components'
import MenuIcon from '@mui/icons-material/Menu';

import { Dropdown } from 'react-bootstrap';
const Navbar = styled.div`
background:transparent;
margin-top:35px;
// background-color:hsl(219, 4%, 4%);;
width:100%;
height:6.5rem;
border-bottom:1px solid #03131E;

display:flex;
align-items:center;
justify-content:space-between;
flex:0;
font-size:20px;

`;
const NavBrand = styled.div`
margin-left: 19rem;
`;

const NavMenu = styled.div`
background-color:#052A44;
justify-content:space-between;
position:relative;
margin-right:19rem;
text-align: center; /* Centered text/links */
@media(max-width:1400px){
    ul{
        display:none;

    }
}
ul{
    list-style:none;
    margin: 0;
    padding: 0;
    li{
        display:inline-flex; 
        padding:8px 35px;
        a{
            text-decoration: none;
            color:#d5dfe6;
            // animation: before 2s;
            // @keyframes before {
            //     from {tranform:Translatex(15px);}
            //     to {tranform:Translatex(13px);}
            //   }

            &:hover{
                color:white;
                padding: 5px 7px;
                // animation: after 0.5s linear;
                // @keyframes after {
                //     from {padding: 11px 13px;}
                //     to {padding: 15px 17px;}
                //   }
            }
        }
    }
}
`;

const NavImage = styled.img`
height:4.2rem;

`;

function Header() {
    return (
        <Navbar>
            <NavBrand>
                <a href='javascript:void(0)'><NavImage src="/images/logo.png" /></a>
            </NavBrand>

            <NavMenu>
                <ul>
                    <li><a href='javascript:void(0)'>Home</a></li>
                    <li><a href='javascript:void(0)'>About</a></li>
                    <li>
                       
                        
                        <Dropdown style={{ 'padding':0 }}>
                        <Dropdown.Toggle variant="" id="dropdown-basic" style={{ 'border':'none','color':'#d5dfe6','font-weight':'bold','font-size':'18px'}}>
                            Brands
                        </Dropdown.Toggle>

                        <Dropdown.Menu style={{ 'background':'hsl(219, 4%, 4%);' }}>
                            <Dropdown.Item href="">Action</Dropdown.Item>
                            <Dropdown.Item href="">Another action</Dropdown.Item>
                            <Dropdown.Item href="#">Something else</Dropdown.Item>
                        </Dropdown.Menu>
                        </Dropdown>
                    </li>
                    <li><a href='javascript:void(0)'>Featured</a></li>
                    <li><a href='javascript:void(0)'><MenuIcon /></a></li>
                </ul>
            </NavMenu>

        </Navbar>
    )
}

export default Header
